import './SubTitle.css';

// Return Title
export default function ReturnSuBTitle(props) {
 return (
  <div className='wrp-subtitle-muungano'>
   <h3>{props.Text}</h3>
   <div
    // style={{ display: 'flex', gap: '1em' }} 
    className='Grey-Color'>
    <h3>{props.cdf}</h3>
    <h3>{props.usd}</h3>
   </div>
  </div>
 );
};
